import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import Header from './Header';
import Home from './Home';

const App:React.FC = () => {
  return (
    <Container fluid>
       <Header />
       <Routes>
          <Route path='/' element={<Home/>}/>
       </Routes>        
    </Container>
  )
}

export default App;
